import data from "../data/data"
import Project from "../components/Project"
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/styles.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';


const App = () =>{
    // <p>Components go here</p>
    return ( <div>
                <Navbar bg="light" expand="lg">
                    <Navbar.Brand>Notes</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Nav className="mr-auto">
                            <Nav.Link href="#home">Projects</Nav.Link>
                            <Nav.Link href="#features">No Projects</Nav.Link>
                        </Nav>
                </Navbar>
                <div>
                {
                    Object.keys(data).map ((project, idx) => 
                        <Project key={idx} project={project} notes={data[project]}/>
                        //console.log("notes: ", data[project]);

                    )

                }
                </div>
            </div>
    )
}


export default App;
